import React from 'react';
import {
    Container,
    ProductArea,
    ProdutcPhoto,
    ProductInfoArea,
    ProductDetails,
    ProductQuantityArea,
    ProductButtons
} from './styled';

export default (data) => {
    return(
        <Container>

            <ProductArea>

                <ProdutcPhoto src={data.image} />

                <ProductInfoArea>
                    <ProductDetails>
                        {data.name}
                        {data.ingredients}
                    </ProductDetails>

                    <ProductQuantityArea>
                        {data.price}
                    </ProductQuantityArea>
                </ProductInfoArea>

            </ProductArea>

            <ProductButtons>

            </ProductButtons>

        </Container>
    );
}
